import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

import MyNavbar from "./components/MyNavbar";
import MyFooter from "./components/MyFooter";

function App() {
  return (
    <div>
      <header>
        <MyNavbar title="History for the soul" color="light" />
      </header>
      <main></main>
      <footer>
        <MyFooter />
      </footer>
    </div>
  );
}

export default App;
